import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Header from "./components/Header.js";
import Category from "./category/Category.js";
import Emojis from "./category/Emojis.js";

import Footer from "./components/Footer.js";

function App() {
  return (
    <>
      <Router>
        <Header />
        <Switch>
          <Route path="/" exact render={Category} />
          <Route path="/tld" exact render={Category} />
          <Route path="/sld" component={Emojis} />
          <Route path="/aboutUs" component={Emojis} />
          <Route path="/contactUs" component={Emojis} />
        </Switch>
        <Footer />
      </Router>
    </>
  );
}

export default App;
